  ?person a n:Person;
    rdfs:label "John Alderdice, Baron Alderdice"@en .
  ?award a n:Award;
    rdfs:label "Royal Medals"@en .
  ?awardee a n:Person;
    foaf:awardee ?award .
  ?almaMater a n:EducationalInstitution;
    rdfs:label ?almaMaterLabel ;
    ns:rdfs:label "Northern Ireland" .
  ?person ns:microformat/ns:vcard fn:almaMater ?almaMater .
  ?nickname a rdf:BNode .
  ?person rdfs:label ?nickname .
  FILTER ( ?almaMater = ?almaMaterLabel )
}

SELECT ?party WHERE {
  ?giulio_andreotti rdfs:label "Partito Popolare Italiano"@it .
  ?romano_prodi rdfs:label "Partito Democratico"@it .
}

