           foaf:alterEgoOf ?persona .
}

SELECT ?person WHERE {
  ?person a dbpedia-owl:Person ;
    rdfs:label "Joseph Stalin"@en ;
    dbpprop:commanderInWorldWarII "Soviet Union in World War II" .
  ?person foaf:awardee [ a owl:Class ; rdfs:label "Order of Suvorov"@en ] .
  ?person dbpprop:led "People's Commissariat of Defense of the Soviet Union"@en
}

SELECT ?claimToFame WHERE {
  ?person rdfs:label "Louis des Balbes de Berton de Crillon, 1st Duke of Mahón"@fr .
  ?person foaf:combatRole "Duke of Mahón" .
  ?person rdfs:subPropertyOf [ a owl:Property; rdfs:label "commander in" ] .
  ?war a rdf:Statement ; 
    rdf:subject ?person ;
    rdf:predicate [ a owl:Property; rdfs:label "partOf" ] ;
    rdf:object [ a owl:Class; rdfs:label "Peninsular War" ] .
  ?war2 a rdf:Statement ; 
    rdf:subject ?person ;
    rdf:predicate [ a owl:Property; rdfs:label "partOf" ] ;
    rdf:object [ a owl:Class; rdfs:label "war of Carl Pontus Gahn" ] .
}

