}

SELECT ?entity WHERE {
  ?entity a dbpedia-owl:Region ;
    rdfs:label "Baden-Württemberg"@de .
  ?administration foaf:organizationHomepage ?url .
  ?administration rdfs:seeAlso [ dbpedia:hasAlmaMater ?almaMater ] .
