}

SELECT ?person WHERE {
  ?capital a nlp:Capital ;
            nlp:Settlement yes .
  ?country a nlp:Country .
  ?district a nlp:District .
  ?capital ns:locatedIn ?district .
  ?person a nlp:Person;
           foaf:deceasedDate ?date .
  FILTER (STR(?date) = "unknown")  # Assuming we want to find a person whose date of death is not known
}

