          rdfs:label "Meshuggah"@en .
  ?associatedArtist a dbpedia-owl:MusicalArtist ;
                 foaf:name ?name .
  ?bandMember ns:memberOf ?associatedArtist .
  FILTER (regex(str(?name), "Don")) }

