WHERE {
  ?war1 a dbpedia-owl:War ;
    dbpedia-owl:conflictParty "Military force of Chile" .
  ?war2 a dbpedia-owl:War ;
    dbpedia-owl:conflictParty "Chile" .
  ?commander rdfs:label ?commanderName .
  ?campero foaf:birthName ?camperoBirthName .
  ?war1 rdfs:label ?war1Label .
  ?war2 rdfs:label ?war2Label .
  ?commander ns:commandedBy ?war1 .
  ?war2 ns:involvedInEvent ?war1
}

